        completed: false
    },
    {
        id: 2,
        title: 'Task 2',
        description: 'Description 2',
        status: 'todo',
        priority: 'low',
        dueDate: '2019-01-01',
        createdAt: '2019-01-01',
        updatedAt: '2019-01-01',
    },
]   


const Tasks = () => {
    return (
        <>
          {tasks.map(task => (
              <h3>{task.text}</h3>
          ))} 
        </>
    )
}

export default Tasks
